newLink.rel = 'stylesheet';
newLink.type = 'text/css';
newLink.href = 'https://cdnjs.cloudflare.com/ajax/libs/bootswatch/5.3.2/cerulean/bootstrap.min.css';
document.head.appendChild(newLink);

